import React from "react";

const Showdata = ({
  InvoiceNumber,
  InvoiceDate,
  ProductName,
  Pack,
  ActualRate,
  Quantity,
}) => {
  return (
    <table>
      <tbody>
        <tr>
          <td>{InvoiceNumber}</td>
          <td>{InvoiceDate}</td>
          <td>{ProductName}</td>
          <td>{Pack}</td>
          <td>{ActualRate}</td>
          <td>{Quantity}</td>
        </tr>
      </tbody>
    </table>
  );
};

export default Showdata;
